import PropTypes from 'prop-types'
import APIService from '../APIService';
import React, {useState, useEffect} from 'react'

function WorkoutList(props) {

    const [new_workout, setNewworkout] = useState('')
    // const [exercise_list, setExerciselist] = useState([])

    const editBtn = (workout) =>{
        props.editBtn(workout)
    }
    console.log(props.workouts)
    console.log(props.exercise_list)

    return (
        <div className="WorkoutList">
            {props.workouts && props.workouts.map(workout => {
                return (
                    <div key = {workout.id}>
                        <h3>{workout.title}</h3>
                        {workout.exercises.map(exercise =>{
                            return (
                                <h2>{exercise.exercise_name}</h2>
                            )
                        })

                        }

                        <div className = "row">
                            <div className = "col-md-1">
                                <button className = "btn btn-primary" onClick  = {() => editBtn(workout)}> Update</button>
                            </div>
                            <div className = "col-md-2">
                                <button className = "btn btn-success" onClick  = {() => editBtn(workout)}> Add new</button>
                            </div>
                        </div>
                    </div>
                    )
                }
            )}
            <div className = "row">
                    <div className = "col-md-1">
                        <button className = "btn btn-primary" onClick  = {() => editBtn(workout)}> Create new Workout</button>
                    </div>
                </div>

            </div> 
    )
}

WorkoutList.propTypes = {
    // workouts: []
}

export default WorkoutList
